import Button from "../component/Button";

const Home = () => {
    return (
        <div>
            <Button
                text={"기본"}
                onClick = {() => {
                    alert("default button");
                }}
             />
             <Button
                type="positive"
                text={"긍정"}
                onClick = {() => {
                    alert("po button");
                }}
             />
             <Button
                type="negative"
                text={"부정"}
                onClick = {() => {
                    alert("ne button");
                }}
             />
        </div>
    );
        
};

export default Home;
